description:
At first, the idea of making a porn feature spoof of the mega-budget James Bond thriller Skyfall might seem a really stupid one, but when that task is assigned to a certain Dick Bush, aka Kaizen XXX, then it may not be so stupid after all. What he has done with Spyfall is nothing short of gobsmacking. Apart from the fact the movie looks amazing in widescreen, it has great action sequences to match the hot sex and delivers a damn good storyline too. They've even managed to find a cast of porno stars who can actually act - how incredible is that? The action scenes and some of the settings convincingly recreate the feel of a genuine Bond movie on about a thousandth of the budget. As for the sex, well it's a thousand times filthier than you're ever going to get down at your local Odeon. If you're looking for a porno spoof that's genuinely licenced to thrill, Spyfall is the one!

